const a={a1:"副标题是用于描述列表或网格列表中的一部分的列表瓦片。",a2:"<strong>副标题</strong>可以显示在瓦片中或者与内容相关联。它们通常与过滤或排序标准有关。",a3:"滚动时，子标题固定在屏幕顶部，直到被下一个子标题推离屏幕。",a4:"副标题类型",a5:"列表",a6:"网格",a7:"菜单",a8:"字体",a9:"列表副标题",a10:"网格副标题",a11:"菜单副标题",a12:"规格",a13:"瓦片高度：48dp<br />副标题字体：Roboto Medium 14sp",a14:"颜色",a15:"副标题的颜色可以是灰色文本值（54% 黑色）或者应用的主色。",a16:"在含复杂信息的长列表中，考虑使用彩色副标题来描述内容。Android 的设置功能包含了一个使用彩色副标题的示例。",a17:"灰色副标题",a18:"内边距：16dp<br />副标题瓦片高度：48dp",a19:"邮件收件箱中的灰色副标题",a20:"对齐方式",a21:"在列表中，副标题应该与头像/图标左对齐，除非在那个空间有更高级的操作。",a22:"如果有一个浮动操作按钮和列表中的头像/图标左对齐，那么把副标题和文本内容对齐。",a23:"含有左对齐的浮动操作按钮时，副标题和文本内容对齐。",a24:"副标题瓦片高度：48dp<br />浮动操作按钮瓦片宽度：72dp",a25:"这个副标题使用应用的主色，并且和文本对齐，因为它有一个左对齐的浮动操作按钮。",a26:"瓦片高度：48dp<br />副标题字体：Roboto Medium 14sp<br />副标题和左边缘有 16dp 的间距",a27:"这个副标题和左边缘有 16dp 的间距。网格副标题瓦片的高度是 48dp。",a28:"用于表示相册中的月份的网格副标题",a29:"瓦片高度：48dp<br />副标题字体：Roboto Medium 14sp<br />副标题和左边缘有 16dp 的间距",a30:"菜单副标题规格",a31:"副标题和左边缘的间距：16dp<br />瓦片高度：48dp",a32:"菜单副标题示例",a33:"Material Design 中的副标题用于描述列表或网格中的瓦片",a34:"Material Design 风格的灰色副标题",a35:"Material Design 的灰色邮件收件箱副标题",a36:"Material Design 中的副标题和文本内容左对齐",a37:"Material Design 中的主色与左对齐文本相结合",a38:"Material Design 中的副标题与左边缘有 16dp 间距",a39:"Material Design 中的月份网格副标题",a40:"Material Design 中的菜单副标题规格",a41:"Material Design 中的菜单副标题示例"};export{a as zhCn};
